    private string[] words = new string[5];
    private string[,] grid = new string[5, 5];
    private static int moduleIDCounter;
    private int moduleID;
    private bool moduleSolved;

    private void Awake()
    {
        for(int i = 0; i < 5; i++)
        {
            words[i] = uwordlist[Random.Range(0, 2408)];
            for (int j = 0; j < 5; j++)
                grid[i, j] = words[i][j].ToString();
        }
        Shufflegrid(true);
        Shufflegrid(false);
        Shufflegrid(true);
        Shufflegrid(false);
        for (int i = 0; i < 25; i++)
            letters[i].text = grid[i / 5, i % 5];
        Debug.LogFormat("[Shufflewords #{0}] The initial grid is:\n[Shufflewords #{0}] {1}", moduleID, string.Join("\n[Shufflewords #" + moduleID + "] ", Enumerable.Range(0, 5).Select(x => (Enumerable.Range(0, 5).Select(y => grid[x, y]).ToArray()).Join()).ToArray()));
        Debug.LogFormat("[Shufflewords #{0}] One possible solution: {1}", moduleID, string.Join(", ", words.OrderBy(x => x).ToArray()));
        foreach(KMSelectable arrow in arrows)
        {
            int a = arrows.IndexOf(arrow);
            arrow.OnInteract = delegate ()
            {
                if (!moduleSolved)
                {
                    Audio.PlaySoundAtTransform("tick", arrow.transform);
                    arrow.AddInteractionPunch(0.2f);
                    string temp = "";
                    int c = a % 5;
                    switch(a / 5)
                    {
                        case 2:
                            temp = grid[4, c];
                            for (int k = 3; k >= 0; k--)
                                grid[k + 1, c] = grid[k, c];
                            grid[0, c] = temp;
                            for (int k = 0; k < 5; k++)
                                letters[(5 * k) + c].text = grid[k, c];
                            break;
                        case 3:
                            temp = grid[c, 0];
                            for (int k = 0; k < 4; k++)
                                grid[c, k] = grid[c, k + 1];
                            grid[c, 4] = temp;
                            for (int k = 0; k < 5; k++)
                                letters[(5 * c) + k].text = grid[c, k];
                            break;
                        case 0:
                            temp = grid[0, c];
                            for (int k = 0; k < 4; k++)
                                grid[k, c] = grid[k + 1, c];
                            grid[4, c] = temp;
                            for (int k = 0; k < 5; k++)
                                letters[(5 * k) + c].text = grid[k, c];
                            break;
                        default:
                            temp = grid[c, 4];
                            for (int k = 3; k >= 0; k--)
                                grid[c, k + 1] = grid[c, k];
                            grid[c, 0] = temp;
                            for (int k = 0; k < 5; k++)
                                letters[(5 * c) + k].text = grid[c, k];
                            break;
                    }
                }
                return false;
            };
        }
        submit.OnInteract = delegate ()
        {
            if (!moduleSolved)
            {
                Audio.PlayGameSoundAtTransform(KMSoundOverride.SoundEffect.ButtonPress, submit.transform);
                submit.AddInteractionPunch();
                string[] rows = new string[5];
                for (int i = 0; i < 5; i++)
                    rows[i] = string.Join("", Enumerable.Range(0, 5).Select(x => grid[i, x]).ToArray());
                string[] cols = new string[5];
                for (int i = 0; i < 5; i++)
                    cols[i] = string.Join("", Enumerable.Range(0, 5).Select(x => grid[x, i]).ToArray());
                bool[][] check = new bool[2][] { new bool[5], new bool[5]};
                for(int i = 0; i < 5; i++)
                {
                    check[0][i] = vwordlist.Contains(rows[i]);
                    check[1][i] = vwordlist.Contains(cols[i]);
                }
                Debug.LogFormat("[Shufflewords #{0}] The rows of the submitted grid are: {1}", moduleID, string.Join(", ", Enumerable.Range(0, 5).Select(x => rows[x] + " (" + (check[0][x] ? "\u2713" : "\u2717") + ")").ToArray()));
                Debug.LogFormat("[Shufflewords #{0}] The columns of the submitted grid are: {1}", moduleID, string.Join(", ", Enumerable.Range(0, 5).Select(x => cols[x] + " (" + (check[1][x] ? "\u2713" : "\u2717") + ")").ToArray()));
                if (check[0].All(x => x) || check[1].All(x => x))
                {
                    moduleSolved = true;
                    module.HandlePass();
                }
                else
                    module.HandleStrike();
            }
            return false;
        };
    }

    private void Shufflegrid(bool h)
    {
        if (h)
        {
            for(int i = 0; i < 5; i++)
            {
                int r = Random.Range(0, 5);
                for(int j = 0; j < r; j++)
                {
                    string temp = grid[i, 0];
                    for (int k = 0; k < 4; k++)
                        grid[i, k] = grid[i, k + 1];
                    grid[i, 4] = temp;
                }
            }
        }
        else
        {
            for (int i = 0; i < 5; i++)
            {
                int r = Random.Range(0, 5);
                for (int j = 0; j < r; j++)
                {
                    string temp = grid[0, i];
                    for (int k = 0; k < 4; k++)
                        grid[k, i] = grid[k + 1, i];
                    grid[4, i] = temp;
                }
            }
        }
    }
